import { Avatar, Button, Menu } from "antd";
import React from "react";
import "./Header.css";
import { UserOutlined } from "@ant-design/icons";

const Header = () => {
  return (
    <header>
      <Menu
        mode="horizontal"
        className="header-menu"
        style={{
          display: "flex",
          justifyContent: "space-between",
          fontSize: "18px",
          fontWeight: "inherit",
        }}
      >
        <div style={{ width: "100%" }}>
          <Menu.Item className="item" key="home">
            <a className="nav-item" href="#home">
              Home
            </a>
          </Menu.Item>
          <Menu.Item className="item" key="courses">
            <a className="nav-item" href="#courses">
              Courses
            </a>
          </Menu.Item>
          <Menu.Item className="item" key="testimonials">
            <a className="nav-item" href="#testimonials">
              Testimonials
            </a>
          </Menu.Item>
          <Menu.Item className="item" key="about">
            <a className="nav-item" href="#about">
              About
            </a>
          </Menu.Item>
        </div>
      </Menu>
      <div>
        <div
          style={{
            height:'5%',
            borderRadius:'25px',
            width: "10%",
            fontSize: "12px",
            background: "black",
            color: "white",
            display:'flex',
            justifyContent:'space-between'
          }}
        >
          <span style={{paddingLeft:'10px', paddingTop:'5px'}}>Hii, Jane Smith</span>
          <Avatar
            size={"small"}
            icon={<UserOutlined />}
            style={{ background: "white", color: "gray" }}
          />
        </div>
      </div>
    </header>
  );
};

export default Header;
